import {MdAddCircleOutline} from "react-icons/md";
import "../Header/header.css";

export default function Header(){
    return <header>
        <h1>EDBOOK</h1>
        <input type="search" placeholder="Search users"/>
        <MdAddCircleOutline size="30px"/>
    </header>
}
